measurements.description:
Four overall flat lily form flowers on one erect 40.0-cm inflorescence;  
   sepals chartreuse blushed maroon, veined maroon, mid-vein darker maroon;

   petals porrect, chartreuse blushed maroon along margins, veined maroon, mid-vein darker maroon;
  lip cream, side lobes overlaid light burgundy, centrally spotted burgundy, crest yellow distally;
column light green, darker marginally, ventral surface blotched burgundy, anther cap cream;   

	substance firm; texture satiny, lip matte.
